## Groups 3-5




::: {.cell layout-align="center"}

```{.r .cell-code}
let2num <- \(x) {

  lets <- stringr::str_extract(x, "[A-Z]")

  look <- rlang::set_names(as.character(1:26), LETTERS)

  unname(look[lets])
}

g3 <- function(x) {

  if (empty(x[["x3"]])) return(character(0))

  num <- x[["x3"]][!stringfish::sf_grepl(x[["x3"]], "[A-Z]")]
  chr <- x[["x3"]][stringfish::sf_grepl(x[["x3"]], "[A-Z]")]

  num <- data.table(
    code = num, 
    lump = dumblump::dumblump(
      as.integer(num), 
      threshold = 3, 
      group_prefix = NULL, 
      group_sep = NULL))

  chr <- data.table(
    code = chr, 
    lump = dumblump::dumblump(
      as.integer(stringr::str_replace_all(chr, "[A-Z]", let2num)), 
      threshold = 3, 
      group_prefix = NULL, 
      group_sep = NULL))

  out <- vctrs::vec_c(
    if (empty(num)) NULL else vctrs::vec_chop(num$code, sizes = vctrs::vec_run_sizes(num$lump)),
    if (empty(chr)) NULL else vctrs::vec_chop(chr$code, sizes = vctrs::vec_run_sizes(chr$lump))
  )

  if (empty(out)) return(character(0))

  return(out)

}

