vrg <- function(x, n) {

  if (is.null(x)) return(NULL)

  postfix <- ifelse(
    stringfish::sf_starts(x, "[A-Z]", nthreads = 4L), 
    "[0-9]", "[A-Z0-9]")

  x <- ifelse(
    n == 0, 
    paste0("(^", x, "$)"),                
    paste0("(^", x, postfix, "{", n, "}$)")) 

  paste0(x , collapse = "|")
}

